import { Link } from "react-router-dom";

function Blog() {
  return (
    <div className="blog-div">
      <div className="blog-grid">
        <section>
          <Link>Things we need to bring for the travel</Link>
          <span>13 June 2025</span>
          <p>Planning your next adventure?</p>
        </section>
      </div>
    </div>
  );
}

export default Blog;
